import React from 'react';
import styled from 'styled-components';

const CategoryBtn = styled.button`
    border: none;
    background: red;
`

function CategoryBotton({ genre }) {
    return (
        <CategoryBtn>{genre}</CategoryBtn>
    )
};

export default CategoryBotton;
